public class PracticeTest {

    @Test
    public void testIsValid() {
        Practice practice = new Practice();
        assertTrue(practice.isValid("()"));
        assertTrue(practice.isValid("()[]{}"));
        assertFalse(practice.isValid("(]"));
        assertFalse(practice.isValid("([)]"));
        assertTrue(practice.isValid("{[]}"));
    }
}
